import React from "react";
import { CustomIcon } from "../marslab-library-react-native/components/atoms";
import Icon from "react-native-vector-icons/Ionicons";
import FontAwesome5 from "react-native-vector-icons/FontAwesome5";
import { Colors } from "../settings/styles/theme";

const iconProfile = () => (
    <Icon name="md-people" color="#c83528" size={24} />
);

const emergency = () => (
    <CustomIcon name="emo-angry" color={Colors.PRIMARY} size={24} />
);

const schedule = () => (
    <FontAwesome5 name="calendar-plus" color={Colors.PRIMARY} size={24} />
);

const ongoing = () => (
    <FontAwesome5 name="ambulance" color={Colors.PRIMARY} size={24} />
);

const completed = () => (
    <FontAwesome5 name="calendar-check" color={Colors.PRIMARY} size={24} />
);

const event = () => (
    <Icon name="ios-ribbon" color={Colors.PRIMARY} size={24} />
);

export { 
    iconProfile, 
    emergency, 
    schedule, 
    ongoing, 
    completed, 
    event 
};
